INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 2, 1, 2.46, 12300150, "vo_minigame_1012_result_1082", "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 3, 9, 2, 5, 0);
